The acclaimed BBC4 Britannia series moves into the world of British reggae. Showing how it
came from Jamaica in the 1960s to influence, over the next 20 years, both British music and
society, the programme includes major artists and performances from that era, including Big
Youth, Max Romeo, Linton Kwesi Johnson, Jerry Dammers and the Specials, the Police,
UB40, Dennis Bovell, lovers rock performers Carroll Thompson and Janet Kay, bands like
Aswad and Steel Pulse and reggae admirers such as Boy George and Paul Weller.

The programme celebrates the impact of reggae, the changes it brought about and its lasting
musical legacy...

